INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52113, 3433, 'Fluoxetine', 'Depressive Disorder', 'Adult and pediatric patients with depression and other psychiatric disorders may experience worsening of their symptoms and may have the emergence of suicidal thoughts and behavior.  Patients should be monitored appropriately and observed closely for worsening of their symptoms, suicidality or changes in their behavior, especially during the first few months of treatment, and at times of dose changes.  Families and caregivers should be advised of the need for close observation and communication with the treating physician.  Discontinuing the medication should be considered if symptoms are persistently worse, or abrupt in onset.  It may be prudent to refrain from dispensing large quantities of medication to these patients.', '3', '', 'DDInter', 0);
