INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52131, 3433, 'Fluoxetine', 'Diabetes Mellitus', 'Fluoxetine may alter blood glucose control in patients with diabetes.  Hypoglycemia may occur during therapy with fluoxetine, and hyperglycemia may occur following discontinuation of the drug.  Dosage adjustments in insulin and/or oral hypoglycemic medications may be necessary in patients with diabetes whenever fluoxetine therapy is initiated or discontinued.', '2', '', 'DDInter', 0);
