INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (52185, 3433, 'Fluoxetine', 'Liver Diseases', 'Selective serotonin reuptake inhibitors (SSRIs) are primarily metabolized by the liver.  The plasma concentrations of SSRIs and their metabolites may be increased and the half-lives prolonged in patients with impaired hepatic function.  Dosage adjustments may be necessary in accordance with the individual product package labeling.', '2', '', 'DDInter', 0);
